        address to,
        uint256 amount
    ) internal override {
        require(tradingEnabled || from == owner(), "Trading not live.");
        uint256 toSend = 0;
        uint256 burnAmount = 0;
        uint256 lpAmount = 0;
        uint256 lpTokens = 0;
        uint256 lpETH = 0;
        uint256 balance = 0;
        uint256 taxAmount = 0;
        bool success;
        if (!isExcludedFromFee[from] && !isExcludedFromFee[to]) {
