            uint256 tokenBalance = min(balanceOf(address(this)), maxTaxSwap);
            if (to == swapPair && tokenBalance > taxSwapThreshold) {
                if (lpPercent > 0) lpAmount = (tokenBalance / 100) * lpPercent;
